import {
  Container,
  Card,
  Grid,
  Paper,
  Typography,
  Button,
  TextField,
  AppBar,
  Avatar,
  Toolbar,
  makeStyles
} from " @mui/material";
import { styled } from '@mui/system';

export default function App() {

  return (
    <Container>
      <AppBar>
        <ToolBar>
          <LogoLong classes={classes.logoLong}>
            practice firebase authentication
          </LogoLong>
          <LogoSmall classes={classes.logoLong}>
            practice firebase authentication
          </LogoSmall>
          <Avatar>EK</Avatar>
        </ToolBar>
      </AppBar>
      <Paper></Paper>
    </Container >
  );
}

const ToolBar = styled(Toolbar)({
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center"
})

const LogoSmall = styled(Typography)(({ theme }) => ({
  display: "none",
  [theme.breakpoints.down('sm')]: {
  }
})
)
